import React, { Component } from 'react'

class AverageTop30Contacted extends Component {
    render() {
        const {avgTop30Contacted} = this.state.averge30TopContacted;
        return (
            <div>
                <center><h1>Average top 30 contacted</h1></center>
                <div className="card">
                    <div className="card-body">
                        <p className="card-text">{avgTop30Contacted}</p>
                    </div>
                </div>

            </div>
        )
    };
};

export default AverageTop30Contacted
